import React from "react";
import Header from "../Header/Header";
import bg from "../../Assets/medicalBG.png";
import "./Home.css";
import { gsap } from "gsap";
function Home() {
  var el = $(".el");
  TweenMax.set(el, { autoAlpha: 0, left: "0%", xPercent: "-50%" });
  var tl = new TimelineMax({ repeat: -1 });

  for (var i = 0; i < el.length; i++) {
    E = el[i];
    tl.to(E, 0.5, { autoAlpha: 1, left: "50%", ease: Power2.easeIn }).to(
      E,
      0.5,
      { left: "100%", autoAlpha: 0, ease: Power2.easeOut },
      "+=2.5"
    );
  }
  return (
    <>
      <Header />
      <div className="home">
        <div className="container">
          <h1>ME-Inspection</h1>
          <p>
            Lorem Ipsum Lorem IpsumLorem IpsumLorem IpsumLorem Ipsum. Lorem
            IpsumLorem IpsumLorem IpsumLorem IpsumLorem IpsumLorem Ipsum Lorem
            IpsumLorem IpsumLorem IpsumLorem IpsumLorem IpsumLorem Ipsum.
          </p>
        </div>
        <div className="home__image">
          <img src={bg} alt="bg"></img>
        </div>
      </div>
    </>
  );
}
export default Home;
